import './Button.css';

const Button = ({
  id,
  type = 'button',
  onClick,
  children,
  bgColor,
  fontSize
}) => (
  <div class='box-1' id={id} type={type} onClick={onClick} fontSize={fontSize}>
    <div class='btn'>
      <span>{children}</span>
    </div>
  </div>
);

export default Button;
